import React from "react";
import axios from "axios";
import { useEffect, useState } from "react";
import PayloadsItems from "./PayloadsItems";
const Payload = () => {
  const [data, setData] = useState([]);
  const fetchData = () => {
    axios
      .get("https://api.spacexdata.com/v4/payloads")
      .then((res) => {
        console.log(res.data);
        setData(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  };
  useEffect(() => {
    fetchData();
  }, []);
  return (
    <div className="container my-5 text-light">
      <h1>Payloads</h1>
      <div className="row">
        {data.map((data) => {
          return (
            <div className="col-md-3 my-1 mx-0" key={data.id}>
              <PayloadsItems
                customers={data.customers}
                name={data.name}
                nationalities={data.nationalities}
                type={data.type}
                reused={data.reused}
                manufacturers={data.manufacturers}
                mass={data.mass_kg}
                orbit = {data.orbit}
              />
            </div>
          );
        })}
      </div>
      Lorem, ipsum dolor sit amet consectetur adipisicing elit. Nihil explicabo
      vero tenetur perferendis architecto ipsum eius. Quo maiores corporis
      molestiae optio modi eius! Quod ratione totam corrupti. Tempora, corrupti
      doloremque.
    </div>
  );
};

export default Payload;
